"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Siguiente","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"sidebar":[{"type":"link","label":"Primeros pasos","href":"/devhub-apps/es/docs/getting-started","docId":"getting-started"},{"type":"category","label":"Herramientas","items":[{"type":"link","label":"Visi\xf3n General","href":"/devhub-apps/es/docs/developer-tools/overview","docId":"developer-tools/overview"},{"type":"link","label":"Plantillas de Aplicaciones","href":"/devhub-apps/es/docs/developer-tools/templates","docId":"developer-tools/templates"},{"type":"link","label":"Nimbus","href":"/devhub-apps/es/docs/developer-tools/nimbus","docId":"developer-tools/nimbus"},{"type":"link","label":"Nexo","href":"/devhub-apps/es/docs/developer-tools/nexo","docId":"developer-tools/nexo"},{"type":"link","label":"API Nuvemshop","href":"/devhub-apps/es/docs/developer-tools/nuvemshop-api","docId":"developer-tools/nuvemshop-api"}],"collapsed":true,"collapsible":true},{"type":"category","label":"Aplicaciones","items":[{"type":"link","label":"Visi\xf3n general","href":"/devhub-apps/es/docs/applications/overview","docId":"applications/overview"},{"type":"link","label":"Autenticaci\xf3n","href":"/devhub-apps/es/docs/applications/authentication","docId":"applications/authentication"},{"type":"link","label":"Incorporada","href":"/devhub-apps/es/docs/applications/native","docId":"applications/native"},{"type":"link","label":"Externos","href":"/devhub-apps/es/docs/applications/standalone","docId":"applications/standalone"}],"collapsed":true,"collapsible":true},{"type":"category","label":"Directrices de dise\xf1o","items":[{"type":"link","label":"Visi\xf3n general","href":"/devhub-apps/es/docs/design-guidelines/overview","docId":"design-guidelines/overview"},{"type":"link","label":"Uso de plantillas de dise\xf1o","href":"/devhub-apps/es/docs/design-guidelines/template-usage","docId":"design-guidelines/template-usage"},{"type":"link","label":"Componentes y Patrones","href":"/devhub-apps/es/docs/design-guidelines/component-usage","docId":"design-guidelines/component-usage"},{"type":"link","label":"Conceptos de UX/UI","href":"/devhub-apps/es/docs/design-guidelines/concept-usage","docId":"design-guidelines/concept-usage"},{"type":"link","label":"Conceptos de UX Writing","href":"/devhub-apps/es/docs/design-guidelines/ux-writing-usage","docId":"design-guidelines/ux-writing-usage"}],"collapsed":true,"collapsible":true},{"type":"category","label":"Homologaci\xf3n","items":[{"type":"link","label":"Visi\xf3n General","href":"/devhub-apps/es/docs/homologation/overview","docId":"homologation/overview"},{"type":"link","label":"Requisitos de Dise\xf1o","href":"/devhub-apps/es/docs/homologation/checklist","docId":"homologation/checklist"}],"collapsed":true,"collapsible":true}]},"docs":{"applications/authentication":{"id":"applications/authentication","title":"Autenticaci\xf3n","description":"Este gu\xeda presenta m\xe9todos de autenticaci\xf3n de aplicaciones con la plataforma Nuvemshop. Descubre c\xf3mo garantizar seguridad y acceso autorizado para integraciones perfectas entre tus aplicaciones y nuestra plataforma.","sidebar":"sidebar"},"applications/native":{"id":"applications/native","title":"Incorporada","description":"Una aplicaci\xf3n incorporada es aquella que opera en el contexto del Administrador de tiendas, utilizando un iframe para garantizar la integraci\xf3n y fluidez. Este enfoque busca ofrecer experiencias m\xe1s naturales e integrada para la gesti\xf3n de las tiendas, mejorando la interacci\xf3n con funcionalidades externas.","sidebar":"sidebar"},"applications/overview":{"id":"applications/overview","title":"Visi\xf3n general","description":"En esta secci\xf3n, proporcionaremos una gu\xeda paso a paso para que pueda crear una aplicaci\xf3n e integrarla en la plataforma Nuvemshop. Antes de comenzar el desarrollo de su aplicaci\xf3n, es necesario crear una cuenta en el Portal de Socios de Nuvemshop. Aprenda c\xf3mo crear su cuenta en el \ud83d\udcdd Gu\xeda: detalles del programa de Socios Tecnol\xf3gicos de Nuvemshop.","sidebar":"sidebar"},"applications/standalone":{"id":"applications/standalone","title":"Externos","description":"Las aplicaciones externas, a diferencia de las aplicaciones incorporada que aparecen en el Administrador de tiendas, son soluciones independientes y se cargan fuera del administrador de tiendas. Operan de forma aut\xf3noma y pueden abarcar una amplia gama de funciones, desde marketing hasta gesti\xf3n de inventario.","sidebar":"sidebar"},"design-guidelines/component-usage":{"id":"design-guidelines/component-usage","title":"Componentes y Patrones","description":"Los componentes de Nimbus son elementos que permiten crear interfaces personalizadas seg\xfan sea necesario, y deben utilizarse cuando no exista un patr\xf3n o modelo que satisfaga el caso de uso. Al aplicar estos modelos, el objetivo es garantizar la cohesi\xf3n con los productos de Nuvemshop y mantener la consistencia de uso con las interfaces existentes.","sidebar":"sidebar"},"design-guidelines/concept-usage":{"id":"design-guidelines/concept-usage","title":"Conceptos de UX/UI","description":"Los componentes Nimbus son elementos para crear interfaces personalizadas seg\xfan sea necesario, cuando no hay un est\xe1ndar disponible. Estos componentes mantienen la consistencia con los productos de Nuvemshop y sus interfaces existentes. Es importante usar los componentes correctamente para garantizar una experiencia de navegaci\xf3n m\xe1s f\xe1cil para los usuarios de Nuvemshop.","sidebar":"sidebar"},"design-guidelines/overview":{"id":"design-guidelines/overview","title":"Visi\xf3n general","description":"Para hacer que la experiencia de desarrollo de aplicaciones incorporadas sea m\xe1s precisa, hemos elaborado una documentaci\xf3n de dise\xf1o exhaustiva destinada a ayudar a los desarrolladores en el proceso de construcci\xf3n de interfaces m\xe1s coherentes y uniformes. Las directrices abarcan diversos conceptos fundamentales con el objetivo de guiar a los desarrolladores para alcanzar los mejores est\xe1ndares de experiencia.","sidebar":"sidebar"},"design-guidelines/template-usage":{"id":"design-guidelines/template-usage","title":"Uso de plantillas de dise\xf1o","description":"Las plantillas de dise\xf1o de Nimbus son herramientas valiosas para garantizar la coherencia visual y una experiencia s\xf3lida en los productos de Nuvemshop. Al utilizar estas plantillas, nuestro objetivo es asegurar una experiencia uniforme alineada con la interfaz del panel de administraci\xf3n de las tiendas de Nuvemshop.","sidebar":"sidebar"},"design-guidelines/ux-writing-usage":{"id":"design-guidelines/ux-writing-usage","title":"Conceptos de UX Writing","description":"Considerar las directrices de UX Writing es fundamental en la construcci\xf3n de una experiencia efectiva y coherente con el resto del administrador de Nuvemshop.","sidebar":"sidebar"},"developer-tools/nexo":{"id":"developer-tools/nexo","title":"Nexo","description":"Nexo proporciona recursos para facilitar la comunicaci\xf3n entre una aplicaci\xf3n externa y el administrador de Nuvemshop. Esta interacci\xf3n entre el administrador y la aplicaci\xf3n se establece mediante mensajes, siguiendo el patr\xf3n de observador, lo que permite la suscripci\xf3n y cancelaci\xf3n de eventos.","sidebar":"sidebar"},"developer-tools/nimbus":{"id":"developer-tools/nimbus","title":"Nimbus","description":"Nimbus es el sistema de dise\xf1o de c\xf3digo abierto de Nuvemshop. Con componentes validados en productos Nuvemshop, patrones y plantillas optimizados, documentaci\xf3n con ejemplos y sincronizaci\xf3n entre el kit de interfaz de usuario en Figma y el c\xf3digo, Nimbus permite a los desarrolladores y dise\xf1adores crear interfaces consistentes, accesibles y de alto rendimiento. Puede usarlo para desarrollar sus aplicaciones dentro del ecosistema de Nuvemshop o para su propio proyecto, teniendo en cuenta la licencia vigente.","sidebar":"sidebar"},"developer-tools/nuvemshop-api":{"id":"developer-tools/nuvemshop-api","title":"API Nuvemshop","description":"La API Nuvemshop es una herramienta para interactuar con nuestra plataforma y expandir las funcionalidades de su aplicaci\xf3n. Antes de comenzar a utilizar nuestra API, es crucial autenticar su aplicaci\xf3n. Despu\xe9s de hacerlo, obtendr\xe1 un access_token \xfanico de autenticaci\xf3n que le permitir\xe1 explorar y utilizar nuestros recursos de la API.","sidebar":"sidebar"},"developer-tools/overview":{"id":"developer-tools/overview","title":"Visi\xf3n General","description":"---","sidebar":"sidebar"},"developer-tools/templates":{"id":"developer-tools/templates","title":"Plantillas de Aplicaciones","description":"Ofrecemos plantillas de aplicaciones que sirven como base para iniciar y acelerar el proceso de desarrollo. Estas plantillas se dividen en dos categor\xedas principales: aplicaciones incorporadas y externas. Cada categor\xeda tiene sus propios modelos espec\xedficos, dise\xf1ados para satisfacer diferentes necesidades y escenarios.","sidebar":"sidebar"},"getting-started":{"id":"getting-started","title":"Primeros pasos","description":"\xa1Bienvenido! En esta documentaci\xf3n encontrar\xe1s todos los recursos y contenidos para crear aplicaciones y ofrecerlos a la base de comerciantes que forman parte de Nuvemshop. Ya seas un desarrollador, un socio o est\xe9s comenzando tu viaje en tecnolog\xeda, aqu\xed encontrar\xe1s informaci\xf3n b\xe1sica para desarrollar aplicaciones para Nuvemshop.","sidebar":"sidebar"},"homologation/checklist":{"id":"homologation/checklist","title":"Requisitos de Dise\xf1o","description":"El prop\xf3sito de este documento es hacer que los requisitos de construcci\xf3n y homologaci\xf3n de dise\xf1o sean m\xe1s transparentes. Estos requisitos se han categorizado seg\xfan la urgencia y la obligatoriedad.","sidebar":"sidebar"},"homologation/overview":{"id":"homologation/overview","title":"Visi\xf3n General","description":"Para poner a disposici\xf3n una aplicaci\xf3n en la tienda de aplicaciones de Nuvemshop, es esencial someterla a un proceso de homologaci\xf3n. Este procedimiento considera tanto el tipo de aplicaci\xf3n como la categor\xeda a la que pertenece, lo que resulta en requisitos que pueden variar. Antes de iniciar el proceso de env\xedo, es fundamental prestar atenci\xf3n a los artefactos y requisitos necesarios. Aseg\xfarate de estar alineado con estas directrices antes de enviar tu solicitud.","sidebar":"sidebar"}}}')}}]);